import { Box, Link } from "@chakra-ui/core";

const NavBar = () => {
  return (
    <Box p={3} w="80vw" color="white" bg="gray.600" boxShadow="md">
      <Link href="/" ml="2">
        Home
      </Link>
      <Link href="/user" ml="2">
        Profile
      </Link>
      <Link href="/stats" ml="2">
        Stats
      </Link>
    </Box>
  );
};

export default NavBar;
